import React from "react";
import LineItem from "./LineItem";

const ItemList=({items,handleCheck,deletefn})=>{
    return(
        <ul>
                {items.map((item)=>(
                    <LineItem 
                    item={item}
                    handleCheck={handleCheck}
                    deletefn={deletefn}
                    />
                ) )}
            </ul>

    )
}

export default ItemList
